import React from 'react';
import { useParams } from 'react-router-dom';

const ChallengePage = () => {
  const { id } = useParams();  // URL에서 id 파라미터를 가져옴

  return (
    <div className="App">
      <h1>챌린지 관리 페이지</h1>
      <p>챌린지 ID: {id}</p>
      {/* 여기서 해당 ID에 대한 세부 정보를 추가로 표시할 수 있습니다 */}
    </div>
  );
};

export default ChallengePage;
